const skills = [
  {id: 'e313', value: 'HTML'},
  {id: 'f980', value: 'CSS'},
  {id: '11eb', value: 'JS'},
  {id: '9a03', value: 'REACT'},
  {id: '65d4', value: 'ANGULAR'},
]
function MesSkills() {
  return (
    <ul>
      {skills.map(skill => (
        <li key={skill.id}>{skill.value}</li>
